import React, {Component} from 'react';
import {Link} from 'react-router-dom'
import axios from "axios";


class TableRow extends Component {
    constructor(props) {
        super(props);
        this.deletesss = this.deletesss.bind(this);
    }
    deletesss(){
        axios.get('http://localhost:4000/rental/admindeletevehicle/'+this.props.obj._id)
            .then(this.setState({redirect: true}))
            .catch(err => console.log(err))
        //this.props.history.push('/index');
        alert("Your Vehicle Successfully Deleted....")
        window.location.replace('/');
    }
    render() {
        return (
            <div>
                <div className='row'>
                    <div className='col'>
                        <img src = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT86MIuNveYiJjN7Ix3qDID7Swdd1J7w_PKrw&usqp=CAU" width="400"/>
                    </div>

                    <div className='col'>
                    <table className="table table-striped">
                        <tr>
                            <td style={{fontWeight:'bold'}}>Id</td>
                            <td>{this.props.obj.id}</td>
                        </tr>
                        <tr>
                            <td style={{fontWeight:'bold'}}>Vehicle Type</td>
                            <td>{this.props.obj.type}</td>
                        </tr>
                        <tr>
                            <td style={{fontWeight:'bold'}}>manufacturer</td>
                            <td>{this.props.obj.manufacturer}</td>
                        </tr>
                        <tr>
                            <td style={{fontWeight:'bold'}}>Admission Number</td>
                            <td>{this.props.obj.campusid}</td>
                        </tr>
                        <tr>
                            <td style={{fontWeight:'bold'}}>phone</td>
                            <td>{this.props.obj.phone}</td>
                        </tr>
                        <tr>
                            <td style={{fontWeight:'bold'}}>email</td>
                            <td>{this.props.obj.email}</td>
                        </tr>
                        <tr>
                            <td> <Link to={"/edit/"+this.props.obj._id} className="btn btn-success">Edit</Link></td>
                            <td><button onClick={this.deletesss} className="btn btn-danger">Delete Account</button></td>
                            <td> <Link to={"/"} className="btn btn-warning">Logout</Link></td>
                        </tr>
                    </table>
                    </div>
                </div>
            </div>
           
        );
    }
}

export default TableRow;
